import React from "react";
import './Home.css';
import bgimg from "../images/Scanner.png";

const Home = () => {
  return (
    <div class="h-100 max-width-100vw" className="home">
        <img
        class="max-width-100vw"
                    src={bgimg}
                    alt="Logo"
                />
    </div>
  );
};

export default Home;
